import React from "react";
import Link from "next/link";

const NavLink = () => {
  return (
    <Link href="/sobre">
      <a>Sobre</a>
    </Link>
  );
};

const Header = () => {
  return (
    <div className="bg-gray-200 ">
      <h1>
        <img src="/logo.png" alt="Logo" className="h-24 py-4 mx-auto" />
      </h1>
      <div className="bg-gray-500 py-4">
        <Link href="/sobre">
          <a>Sobre</a>
        </Link>
        <Link href="/cadastro">
          <a>Cadastro</a>
        </Link>
        <Link href="/entrar">
          <a>Entrar</a>
        </Link>
      </div>
    </div>
  );
};

export default Header;
